/* jshint esversion:8 */
/* global $, swal */
(async function() {
    'use strict';

    $(function(){
        if($(".cf-error-code").length > 0 && parseInt($(".cf-error-code").text()) >= 500){
            console.log("Server error detected, trying to reload...");
            location.reload();
        }
    });

    function mark(target, parentLevel=0){
        let focus = $(target);
        for(let i = 0; i < parentLevel; i++){
            focus = focus.parent();
        }
        focus.css("color", "red");
    }
    
    if(await GM.getValue("previewFlag", false)){
        var previewBtn = $(`<button class="button" onclick="return false;">預覽表單</button>`);
        previewBtn.on("click", function(){
            swal(JSON.stringify($("form").serialize().replace(/=/gi, ':').split('&').reduce(function(a,b){
                let key = b.split(':')[0];
                let val = b.split(':')[1];
                a[key] = val;
                return a;
            },{}),null,2));
        });
        previewBtn.insertBefore($("form,div[class*=button]").find("button[type='submit'],button:contains('儲存'):eq(0),button:contains('修改'):eq(0)"));
    }

    var container = $(`<div class="__CLJS__container"><style>.widget:hover{top: -30px !important;}</style></div>`);
    var main_button = $(`<button>cmdLine</button>`);
    var widget = $(`<button class="widget"></button>`);
    container.css({
        "position": "fixed",
        "bottom": "15px",
        "right": "15px",
        "background-color": "burlywood",
        "width": "80px",
        "height": "35px"
    });
    widget.css({
        "position": "absolute",
        "cursor": "pointer",
        "height": "25px",
        "width": "25px",
        "border-radius": "10em",
        "top": "-3px",
        "right": "calc(20% - 10px)",
        "background-color": "rgba(0, 0, 0, 0.75)",
        "background-image": "url(data:image/png;base64,)",
        "background-size": "cover",
        "box-shadow": "black 0px 0px 5px 1px",
        "transition": "top 0.8s ease-in 0.3s",
        "z-index": "1"
    });
    main_button.css({
        "background": "inherit",
        "border": "0px",
        "z-index": "3",
        "width": "100%",
        "height": "100%",
        "position": "relative"
    });
    container.append(main_button);
    container.append(widget);

    var stopMouseEvent = async function(){
        
    }

    var cmd = async function(){
        var cmdText = await prompt("Usage: /command [argc] ...[args]");
        if(!!cmdText){
            if(cmdText.substr(0,1) == '/'){
                var args = cmdText.substr(1).split(' ');
                var todo = args.shift();
                switch(todo){
                    case "help":
                    default:
                        var txt = ` -help\n`;
                        txt += `\tShows help messages\n`;
                        txt += `\tUsage: /help\n`;
                        txt += ` -countTableRows\n`;
                        txt += `\tShows count of specified element\n`;
                        txt += `\tUsage: /countTableRows [id]\n`;
                        txt += ` -count\n`;
                        txt += `\tGet count of element with selector\n`;
                        txt += `\tUsage: /count [selector]\n`;
                        txt += ` -listTables\n`;
                        txt += `\tShows elements id like table\n`;
                        txt += `\tUsage: /listTables\n`;
                        txt += ` -clearRequired\n`;
                        txt += `\tRemove required class\n`;
                        txt += `\tUsage: /clearRequired\n`;
                        txt += ` -mark\n`;
                        txt += `\tMark specified element with selector\n`;
                        txt += `\tUsage: /mark [selector] [parentLevel(optional)]\n`;
                        txt += ` -preview\n`;
                        txt += `\tToggles a in-form button to preview formdata\n`;
                        txt += `\tUsage: /preview`;
                        console.log(txt);
                        break;
                    case "count":
                        if(args.length == 1){
                            console.log(`Count ${args[0]}: ${$(`${args[0]}`).length}`);
                        }else if(args.length > 1){
                            console.log(`Count ${args.join(' ')}: ${$(`${args.join(' ')}`).length}`);
                        }else{
                            console.log('invalid argument');
                        }
                        break;
                    case "countTableRows":
                        if(args.length == 1){
                            console.log(`${$(`#${args[0]} tr`).length} rows in ${args[0]}`);
                        }else{
                            console.log('invalid argument');
                        }
                        break;
                    case "listTables":
                        $("table,thead,tbody").each(function() {
                            console.log("---Table ID List---\n");
                            if($(this).attr("id")){
                                console.log(` ${$(this).attr("id")}`);
                            }
                        });
                        break;
                    case "clearRequired":
                        $(".required").each(function() {
                            $(this).removeClass("required");
                        });
                        console.log("all required removed :)");
                        break;
                    case "mark":
                        if(args.length == 1){
                            mark(args[0]);
                            console.log(`Marked ${$(`${args[0]}`).length} elements`);
                        }else if(args.length > 1){
                            if(!!parseInt(args[args.length - 1]) || args[args.length - 1] == '0'){
                                if(args.length == 2){
                                    mark(args[0], args[1]);
                                    console.log(`Marked ${$(`${args[0]}`).length} elements`);
                                }else if(args.length > 2){
                                    let level = args.pop();
                                    mark(args.join(' '), level);
                                    console.log(`Marked ${$(`${args.join(' ')}`).length} elements`);
                                }
                            }
                        }
                        break;
                    case "preview":
                        var previewFlag = await GM.getValue("previewFlag", false);
                        GM.setValue("previewFlag", !previewFlag);
                        location.reload();
                        break;
                }
            }
        }
    };

    main_button.on("click", cmd);
    widget.on("click", stopMouseEvent);
    $("body").append(container);
})();